import React, { useState } from 'react';
import './navigationbar.css';
import { Collapse, Nav, Navbar, NavItem, NavLink, NavbarBrand } from 'reactstrap'; 


const NavigationBar = () => {
    const [isOpen, setIsOpen] = useState(false);

    // Function to toggle the sub navigation
    const toggleSubMenu = () => {
        setIsOpen(!isOpen);
    };
  return (
<div className="sidebar">
            <Navbar color="light" light expand="md" className="flex-md-column">
                <NavbarBrand href="/">My Website</NavbarBrand>
                <NavbarToggler onClick={toggleSubMenu} />
                <Collapse isOpen={isOpen} navbar>
                    <Nav navbar>
                        <NavItem>
                            <NavLink href="#">
                                <FontAwesomeIcon icon={faHome} />
                                Home
                            </NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink href="#">
                                
                                Profile
                            </NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink href="#">
                                
                                Settings
                            </NavLink>
                        </NavItem>
                    </Nav>
                </Collapse>
            </Navbar>
        </div>
    );
};

export default NavigationBar;
